from stringold import rindex


class Solution(object):
    def takeCharacters(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        def canTake(target):
            left = 0
            while left <= target:
                from collections import defaultdict
                dicts = defaultdict(int)
                right = target - left
                for x in range(left):
                    dicts[s[x]] += 1
                for x in range(right):
                    dicts[s[-1 - x]] += 1
                # print(left, right, dicts)
                # print(left, right, dicts)
                matched = False
                if len(dicts) == 3:
                    matched = True
                    for key in dicts:
                        if dicts[key] < k:
                            matched = False
                if matched:
                    return True
                left += 1
            return False

        # pre-process
        L = len(s)
        if k == 0:
            return 0

        left = 0
        right = L

        # process
        while left + 1 < right:
            middle = (left + right) // 2
            if canTake(middle):
                right = middle
            else:
                left = middle + 1

        if canTake(left):
            return left
        elif canTake(right):
            return right
        else:
            return -1


